 ,(124,' \r\nServices\r\n A Lawler Financial Services investment strategy is unique to your circumstances and aims to suit your lifestyle goals. We focus on your needs and helping you achieve your financial objectives through our tailored financial strategies, comprehensive range of services, educational opportunities and trusted professional partnerships.  estate-planning - Estate Planning -  -  Passing control of your assets to your intended beneficiaries on death is a critical concern for many Australians. There are many issues that should be considered when formulating an estate plan, such as tax effective strategies for beneficiaries and protecting your assets from legal disputes. \r\n Our team can assist you to ensure that your estate is protected and administered in a cost effective and timely manner. \r\n A good estate plan can provide you with peace of mind and help avoid potential complications for your beneficiaries. \r\n Make an enquiry with one of our Authorised Financial Planners.  retirement-planning - Retirement Planning -  -  Having a financial plan for your retirement years is essential to help you achieve the life you want to live in retirement. \r\n There is a growing trend that Australians are retiring earlier from full time employment and generally living much longer than previous generations. People are now spending more than a quarter of their lives in retirement, but how far will their accumulated savings last, and what kind of lifestyle will be available to them? \r\n This is where Lawler Financial Services can assist you with a strategy to help you live the lifestyle you\'d like when you reach retirement. \r\n Make an enquiry with one of our Authorised Financial Planners.  investment-advice - Investment Advice -  -  The principles of investing are simple when you know the best way to reach your accumulation goals. Principles of dollar cost averaging, compounding interest, a regular savings plan, as well as placing your money in an appropriate investment facility to suit your unique needs can reap rewards when you stick to the plan. \r\n Our investment recommendations are customised to your specific requirements and can extend to any or all of the following asset classes: \r\n\r\nAustralian Equities - Direct, Index Funds or Actively Managed Funds\r\nInternational Equities - Index Funds or Actively Managed Funds\r\nEmerging Markets - Actively Managed Funds\r\nProperty Securities - Index Funds or Actively Managed Funds\r\nGovernment Bonds - Direct, Index Funds or Actively Managed Funds\r\nCorporate Bonds - Direct, Index Funds or Actively Managed Funds\r\nTerm Deposits\r\n\r\n Our team works with you to provide advice on how to best meet your investment goals. \r\n Make an enquiry with one of our Authorised Financial Planners.  superannuation-wealth-creation-strategies - Superannuation and Wealth Creation Strategies -  -  Superannuation is one of the most tax-effective ways of saving for your retirement. The maximum rate of tax you’ll pay on your earnings in your super fund is 15% and you’re not charged tax on withdrawals from super once you turn 60, whereas earnings on your normal savings outside super are taxed at your marginal tax rate, which can be anywhere up to 46.5% including Medicare levy. \r\n While you can shift your super between super funds, remember that contributions to super are almost always compulsorily preserved. This means that you generally can’t withdraw the funds until you are over 55 (increasing to age 60 if you were born after 1 July 1964) and meet a condition of release. \r\n Make an enquiry with one of our Authorised Financial Planners.  self-managed-super-funds - Self Managed Super Funds -  -  An SMSF is a trust where money or assets are held and managed on behalf of up to four members to provide benefits for their retirement. It\'s the most flexible of superannuation options with investment choices limited only to the investment strategy of the superannuation fund. \r\n Subject to certain exceptions, all members of an SMSF must be trustees of the SMSF or directors of the SMSF’s corporate trustee. \r\n The investment strategy must comply with the provisions of the Superannuation Industry (Supervision) Act 1993. Therefore, in addition to the wide selection of managed funds, you may also have real property in your superannuation fund and the universe of CHESS listed securities, provided the investment strategy of the fund allows this. \r\n Like all super funds, an SMSF receives concessional tax treatment. The top tax rate for the investment earnings of your SMSF is 15%. This tax concession is only available if your fund complies with all the rules and regulations that apply to SMSFs. In other words, it\'s a ‘complying fund’. \r\n Advising the trustees of an SMSF is a specialised area and our Financial Advisers have extensive training and experience in advising those who have or would like to establish an SMSF. \r\n Make an enquiry with one of our Authorised Financial Planners.  tax-effective-planning - Tax Effective Planning -  -  Lawler Financial Services does not provide specific tax advice. However, the investment advice and financial strategies we provide may be structured in such a way that can reduce tax liability as well as increase after tax returns on your portfolio. \r\n Tax planning is an integral part of the financial planning process. Such strategies as structuring the way you receive your salary, contributing to superannuation, maintaining investments as well as managing debt can all contribute to significant tax savings and is an essential part of your wealth creation journey. \r\n Make an enquirywith one of our Authorised Financial Planners.  direct-equities - Direct Equities -  -  Lawler Financial Services does not provide specific tax advice. However, the investment advice and financial strategies we provide may be structured in such a way that can reduce tax liability as well as increase after tax returns on your portfolio. \r\n Tax planning is an integral part of the financial planning process. Such strategies as structuring the way you receive your salary, contributing to superannuation, maintaining investments as well as managing debt can all contribute to significant tax savings and is an essential part of your wealth creation journey. \r\n Make an enquiry with one of our Authorised Financial Planners.  protected-loans - Protected Loans -  -  Having a Protected Loan attached to an investment portfolio allows you to enjoy the benefits of a rising stock market without the risk of capital loss when markets fall. \r\n Capital gains, dividends and franking credits are received on the protected shares. However, if the securities fall in value your portfolio is protected from any loss. As long as you hold the shares, you will continue to receive any associated benefits. The stock price protection remains valid as long as you don\'t default on interest payments or terminate your loan early. \r\n Make an enquiry with one of our Authorised Financial Planners.  insurance - Insurance -  -  Insurance can help to protect your family and business during unexpected down time or loss. Each year thousands of Australians are injured, suffer a serious illness or die unexpectedly. If this happened in your family or business would you be able to afford: \r\n   \r\n\r\nYour current living or operational expenses?\r\nOngoing expenses such as the monthly mortgage or property rental payment?\r\nThe cost of additional help?\r\nSufficient retirement savings?\r\n\r\n   \r\n We can help you find the right kind of cover for your situation and answer your questions about how to fund your insurance, how tax is affected, and whether your insurance can be held within your superannuation fund. \r\n   \r\n Make an appointment with Chris Davis. \r\n Learn more about Insurance.  margin-lending - Margin Lending -  -  Margin lending, also known as \'gearing\', enables you borrow money to invest in shares, managed funds, master trusts and wraps. \r\n By borrowing to invest, rather than just using your own money, you increase potential for greater returns. The down side of this, though, is that it also magnifies the potential for losses if investments perform poorly so it’s not a strategy for every investor. \r\n Just like investing in property where the loan is secured against the property, your margin loan is secured against your investments. \r\n Make an enquiry with one of our Authorised Financial Planners.  negative-gearing - Negative Gearing -  -  Borrowing to invest, also known as \'gearing\', allows you to buy into investments that you would not otherwise be able to access. \r\n Most people associate negative gearing with buying an investment property. However, borrowed funds can also be used for shares, managed funds or bonds. \r\n While many adopt a negative gearing strategy for its tax advantages, it\'s important to be aware that a tax deduction can only be claimed if there is a loss on the investment. This means it\'s important to borrow sensibly because, similar to margin lending, gearing can amplify investment gains as well as magnify losses. \r\n Make an enquiry with one of our Authorised Financial Planners.  instalment-gearing - Instalment Gearing -  -  Not everyone can borrow a large lump sum of money for the purpose of building an investment portfolio. Instalment gearing enables you to take advantage of the principle of dollar cost averaging by periodically drawing from an investment loan. Regular monthly contributions in a fluctuating share market can yield strong results over the medium to long term, and adding your own money to the borrowed funds can help boost your investment to achieve your financial goals. \r\n Instalment Gearing is also an effective tax strategy because the interest on your borrowing is tax deductible. \r\n Make an enquiry with one of our Authorised Financial Planners.  ','Services','','/services','2013-11-22 13:43:00','2014-01-19 15:19:18',NULL,0)
