 ,(130,'Insurance, Estate Planning\r\n Senior Risk Adviser Chris Davis is head of the risk management team at Lawler Financial Services. \r\n Chris completed a Bachelor of Commerce at The University of Newcastle in 1997 and since then has worked in the financial services industry in both Sydney and Newcastle, joining Lawler Financial Services in 2006. He has a Diploma in Financial Planning, is a Life Risk Specialist with the Financial Planning Association of Australia (FPA) and is an authorised representative of Securitor Financial Group Ltd.    \'Appropriate insurance protection forms the foundation for a client’s financial future,\' he says, \'and implementing long-term sustainable risk insurance protection forms a critical part of the overall service package that our clients receive.\' \r\n  Chris enjoys spending time with his young family and is a passionate surfer who is often spotted at Merewether Beach. \r\n   \r\n\r\n   \r\nProfessional Snapshot\r\n ASIC authorised representative identification number: 321627 \r\n Authorised by Securitor to provide Financial Services including advice under Securitor’s licence on the following financial products: \r\n\r\nManaged investments\r\nSuperannuation\r\nPersonal insurance.\r\n\r\n Not authorised to provide advice, services or products (but can provide a referral) in: \r\n\r\nMortgage broking\r\nFinance broking\r\nShares\r\nSelf Managed Superannuation Funds – investment advice only (including advice to establish an SMSF).\r\n\r\n  \r\n\r\n\r\nContact Information\r\n\r\n(02) 4928 7000\r\n\r\n \r\n  ','Chris Davis','','/people/chris-davis','2013-11-24 16:00:00','2014-01-15 12:48:58',NULL,0)
