 ,(141,' \'Earlier this year, the Government sought to tighten the rules surrounding the transfer of assets to self-managed superannuation funds (SMSFs) from related parties.\' \r\n Damien\'s article explains what this means and what you can transfer to an SMSF. \r\n Click here to access the full article.   The Hunter Business Review recently published an article written by our own SMSF expert, Damien Passmore.  ','Transfer your assets to Superannuation: SMSFs and Related Party Transfers','','/news/transfer-your-assets-superannuation-smsfs-and-related-party-transfers','2013-10-16 06:59:00','2014-01-05 14:05:12',NULL,0)
 ,(142,' BT Financial Group\'s Chief Economist, Chris Caton provides a de-brief on key changes in light of the Federal Government Budget which was handed down on 8 May 2012.   Key Highlights \r\n • Commitment to previously legislated personal tax cuts from 1 July 2012 • Deferral of higher concessional contribution threshold until 1 July 2014 • Introduction of higher tax on concessional super contributions for high income earners • Removal of CGT discounting for non-resident individuals \r\n Access the full article  ','BT Federal Budget Update 2012','','/news/bt-federal-budget-update-2012','2012-06-28 13:03:00','2014-01-05 14:13:16',NULL,0)
 ,(143,' Chris Caton, Chief Economist at BT Financial Group, discusses the financial markets in Australia, Europe and the US so far.   Information copyright BT Financial Group, posted 1 March 2012. \r\nAbstract \r\nThe Australian share market had a moderate month in February, advancing by 0.8%, to bring its gain for the year to date to 6.0%. The US share market once again did better, rising by 4.1%, as measured by the S&P index. This puts the year-to gain at 8.6%, with this measure of the market at its highest level since June 2008, and up by a remarkable 102% from its closing trough on 9 March 2009. It perplexes many investors that the US market has outperformed the Australian market, which is up less than 40% from its March 2009 low. Suffice it to say that such comparisons always depend critically on the starting point. Measure both markets from 2000, for example, and we have outperformed by a street. \r\n Access the full article  ','Catons Corner March 2012: So far, so good (part 2)','','/news/catons-corner-march-2012-so-far-so-good-part-2','2012-03-20 13:44:00','2014-01-05 14:12:51',NULL,0)
