 ,(149,'Privacy Policy\r\n Disclaimer \r\n This site is maintained by Lawler Financial Services and we endeavour to ensure accuracy of content and 24/7 access. However, the Internet is not a 100% secure environment so we cannot guarantee or warrant the truth, accuracy, availability, reliability or currency of the information supplied, or that it is free of computer viruses or other harmful elements. Therefore, you alone are responsible for your use of the site and any risks associated with online access. We disclaim all liability for any loss or damage whatsoever and however caused, that may eventuate from your using this site. \r\n We extend this disclaimer to your access to other sites that are provided on this site as hyperlinks solely for your interest. We disclaim responsibility for your use of, and content on, those sites. \r\n Intellectual property rights on this site (including copyright in all text, graphics, logos, icons, sound recordings and software) are owned by, or licensed to, Lawler Financial Services. \r\n Other than for purposes of your sole reference, you must not copy, adapt, reproduce, store, publish or commercialise any information provided on this service without our prior written permission. \r\n We may make amendments to any part of this website at any time without notice.  The information on this website is of a general nature and should not be used as advice.  Third Party Information and Links  Some of the information displayed on this website may be provided by third parties who are not related to Lawler Financial Services. Lawler Financial Services is not in any way responsible for and does not guarantee the quality or accuracy of any third party information.  This website may also contain links to websites operated by third parties who are not related to Lawler Financial Services. These links are provided for convenience only and do not represent any endorsement or approval by Lawler Financial Services of those third parties or the information, products or services displayed or offered on their websites.  To the maximum extent permitted by law, Lawler Financial Services not be liable to any party for any loss or damage arising either directly or indirectly from reliance on, the use of or inability to use any third party information or websites.  General Advice Notice  Any investment information or general advice published on this website does not take into account an individual\'s personal objectives, financial situation or needs and before acting on any information or advice, you should consider whether it is appropriate for you. You should also consider obtaining independent legal, financial and/or other professional advice before making a decision in relation to any investment.   In deciding whether to commence or to continue to hold an investment through Lawler Financial Services, you should carefully read the relevant Product Disclosure Statement or Financial Services Guide for that product(s). Information about the relationship between Securitor and Lawler Financial Services and the remuneration (including commission) or other benefits that we may receive for the financial services we provide is set out in the Financial Services Guide.   Managed investments and/or shares selected through Lawler Financial Services are subject to investment risk, including possible delays in repayment and the loss of income and capital invested. No team member of Lawler Financial Services guarantees the capital value and/or the performance of the specific investments you select.  You should also be aware that past funds performance and historical market trends are not indicative or a guarantee of future performance. \r\n    ','Privacy Policy','','/privacy-policy','2014-01-10 02:39:00','2014-01-10 02:43:37',NULL,0)
