 ,(151,' Director and Financial Adviser Mark Arnold has been providing financial advice since 1988 and his more than 25 years experience in accounting, taxation and other financial services disciplines has earned him respect in the industry. He is regularly invited to present at seminars on financial planning for CPA Australia and frequently quoted on financial matters in the media.  Mark has lectured in financial planning at The University of Newcastle and was Honorary Conjoint Lecturer to the Faculty of Business and Economics. He is co-author of the text ‘Introduction to Individual Financial Planning’ and also a Justice of the Peace.  Professional Snapshot\r\n ASIC Authorised Representative number:239326 ASIC Credit Representative number: 378848 \r\n Authorised by Securitor to provide Financial Services including advice under Securitor’s licence on the following financial products: \r\n\r\nManaged investments\r\nShares\r\nMargin lending\r\nSuperannuation\r\nSelf Managed Superannuation Funds – investment advice only (including advice to establish an SMSF).\r\n\r\n Not authorised to provide advice, services or products (but can provide a referral) in: \r\n\r\nPersonal insurance\r\nMortgage broking\r\nFinance broking.\r\n ','Mark Arnold','','/people/mark-arnold','2014-01-15 14:27:00','2014-01-15 14:48:34',NULL,0)
 ,(152,' Craig started his career as an Accountant in 1990 at his family\'s renowned manufacturing company, Ampcontrol Pty Ltd, where he gained valuable experience before moving into the chartered environment with Lawler Partners in 1993 as Superannuation Manager. \r\n When the Lawler group commenced business in the financial planning industry in 1998 Craig was engaged as a Senior Adviser due to his experience and specialist skill in the Superannuation environment, and in particular with Self Managed Super Funds. \r\n His combined 18 years in superannuation with previous public practice accounting experience enables him to offer clients a holistic view of wealth maximisation across all entities and taxation structures. \r\n As a holder of the Specialist Adviser designation within the Self-Managed Super Fund Professionals’ Association of Australia (SPAA), Craig also has in depth expertise in this area. \r\n Craig and wife Sharon live in the Newcastle region with their two young boys. \r\n Craig was awarded Securitor Adviser of the Year Award for 2012 in April and this could not be achieved without the faith of our clients in our service and commitment. \r\nProfessional Snapshot\r\n ASIC Authorised Representative number:239484 ASIC Credit Representative number: 378846 Specialist Adviser - SMSF Professionals\' Association \r\n Authorised by Securitor to provide Financial Services including advice under Securitor’s licence on the following financial products: \r\n\r\nManaged investments\r\nSuperannuation\r\nSelf Managed Superannuation Funds – investment advice only (including advice to establish an SMSF)\r\nShares\r\nMargin lending.\r\n\r\n Not authorised to provide advice, services or products (but can provide a referral) in: \r\n\r\nPersonal insurance\r\nMortgage broking\r\nFinance broking.\r\n  Certified Financial Planner Craig Sawyer has been providing financial advice to clients since 1993. He holds a CFP (Certified Financial Planner), Diploma of Financial Planning and Advanced Commerce Certificate.  \r\n   \r\n Craig started his career as an Accountant in 1990 at his family\'s renowned manufacturing company, Ampcontrol Pty Ltd, where he gained valuable experience before moving into the chartered environment with Lawler Partners in 1993 as Superannuation Manager. \r\n When the Lawler group commenced business in the financial planning industry in 1998 Craig was engaged as a Senior Adviser due to his experience and specialist skill in the Superannuation environment, and in particular with Self Managed Super Funds. \r\n His combined 18 years in superannuation with previous public practice accounting experience enables him to offer clients a holistic view of wealth maximisation across all entities and taxation structures. \r\n As a holder of the Specialist Adviser designation within the Self-Managed Super Fund Professionals’ Association of Australia (SPAA), Craig also has in depth expertise in this area. \r\n Craig and wife Sharon live in the Newcastle region with their two young boys. \r\n Craig was awarded Securitor Adviser of the Year Award for 2012 in April and this could not be achieved without the faith of our clients in our service and commitment. \r\nProfessional Snapshot\r\n ASIC Authorised Representative number:239484 ASIC Credit Representative number: 378846 Specialist Adviser - SMSF Professionals\' Association \r\n Authorised by Securitor to provide Financial Services including advice under Securitor’s licence on the following financial products: \r\n\r\nManaged investments\r\nSuperannuation\r\nSelf Managed Superannuation Funds – investment advice only (including advice to establish an SMSF)\r\nShares\r\nMargin lending.\r\n\r\n Not authorised to provide advice, services or products (but can provide a referral) in: \r\n\r\nPersonal insurance\r\nMortgage broking\r\nFinance broking. \r\n\r\n    ','Craig Sawyer','','/people/craig-sawyer','2014-01-15 14:31:00','2014-01-15 15:07:43',NULL,0)
 ,(153,' Mandy joined the Lawler Financial Services team in July 2006 in the Administration and Client Services role. She has more than eight years experience in the retail financial services industry. \r\n People are important to her. Prior to joining the financial industry she worked for more than 20 years in face to face sales, managing branches for such organisations as Colorado and JeansWest. \r\n Being a people person, Mandy says, \'I don\'t get to see as much of our clients as I\'d like.\' However, her management skills are invaluable and she uses them to ensure that clients are serviced well from an administrative perspective. \r\n \'I really like our clients. I\'ve built good relationships with them.\'  ','Mandy Mckenna','','/people/mandy-mckenna','2014-01-15 14:34:00','2014-01-15 14:50:31',NULL,0)
