 ,(155,' Damien is an Authorised Financial Adviser and a Member of the Institute of Chartered Accountants in Australia who specialises in wealth creation across all entities. He has extensive experience as a financial adviser, having practiced in accounting, superannuation and related fields since 1991. Qualified through SPAA as a Specialist Advisor, he provides strategic and investment advice to a wide range of clients.   His combined 15 years in superannuation with previous public practice accounting experience enables him to offer clients a holistic view of wealth maximisation across all entities and taxation structures. In addition, Damien’s prior experience in tax and business services means that he is able to work proactively with other advisers to his clients, such as their accountants and solicitors.  As a holder of the Specialist Adviser designation within the Self-Managed Super Fund Professionals’ Association of Australia (SPAA), Damien also has in depth expertise in this area. \r\nProfessional Snapshot\r\n ASIC Authorised Representative number:305752 ASIC Credit Representative number: 378795 \r\n Authorised by Securitor to provide Financial Services including advice under Securitor’s licence on the following financial products: \r\n\r\nManaged investments\r\nSuperannuation\r\nShares\r\nMargin lending\r\nSelf Managed Superannuation Funds – investment advice only (including advice to establish an SMSF).\r\n\r\n Not authorised to provide advice, services or products (but can provide a referral) in: \r\n\r\nPersonal insurance\r\nMortgage broking\r\nFinance broking.\r\n\r\n Qualifications: \r\n\r\nGraduate Certification - Financial Planning (Finsia)\r\nChartered Accountant - ICAA\r\nSpecialist Adviser - SMSF Professionals\' Association\r\nBachelor of Commerce - University of Newcastle\r\n ','Damien Passmore','','/people/damien-passmore','2014-01-15 15:17:00','2014-01-15 15:20:32',NULL,0)
