unds</li>\r\n<li><strong>International Equities</strong> - Index Funds or Actively Managed Funds</li>\r\n<li><strong>Emerging Markets</strong> - Actively Managed Funds</li>\r\n<li><strong>Property Securities</strong> - Index Funds or Actively Managed Funds</li>\r\n<li><strong>Government Bonds</strong> - Direct, Index Funds or Actively Managed Funds</li>\r\n<li><strong>Corporate Bonds</strong> - Direct, Index Funds or Actively Managed Funds</li>\r\n<li><strong>Term Deposits</strong></li>\r\n</ul>\r\n<p>Our team works with you to provide advice on how to best meet your investment goals.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#superannuation-wealth-creation-strategies\" data-toggle=\"collapse\" data-parent=\"#accordion\"> Superannuation &amp; Wealth Creation Strategies </a></h4>\r\n</div>\r\n<div id=\"superannuation-wealth-creation-strategies\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>Superannuation is one of the most tax-effective ways of saving for your retirement. The maximum rate of tax you’ll pay on your earnings in your super fund is 15% and you’re not charged tax on withdrawals from super once you turn 60, whereas earnings on your normal savings outside super are taxed at your marginal tax rate, which can be anywhere up to 46.5% including Medicare levy.</p>\r\n<p>While you can shift your super between super funds, remember that contributions to super are almost always compulsorily preserved. This means that you generally can’t withdraw the funds until you are over 55 (increasing to age 60 if you were born after 1 July 1964) and meet a condition of release.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#self-managed-super-funds\" data-toggle=\"collapse\" data-parent=\"#accordion\">Self Managed Super Funds </a></h4>\r\n</div>\r\n<div id=\"self-managed-super-funds\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>An SMSF is a trust where money or assets are held and managed on behalf of up to four members to provide benefits for their retirement. It\'s the most flexible of superannuation options with investment choices limited only to the investment strategy of the superannuation fund.</p>\r\n<p>Subject to certain exceptions, all members of an SMSF must be trustees of the SMSF or directors of the SMSF’s corporate trustee.</p>\r\n<p>The investment strategy must comply with the provisions of the Superannuation Industry (Supervision) Act 1993. Therefore, in addition to the wide selection of managed funds, you may also have real property in your superannuation fund and the universe of CHESS listed securities, provided the investment strategy of the fund allows this.</p>\r\n<p>Like all super funds, an SMSF receives concessional tax treatment. The top tax rate for the investment earnings of your SMSF is 15%. This tax concession is only available if your fund complies with all the rules and regulations that apply to SMSFs. In other words, it\'s a ‘complying fund’.</p>\r\n<p>Advising the trustees of an SMSF is a specialised area and our Financial Advisers have extensive training and experience in advising those who have or would like to establish an SMSF.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#tax-effective-planning\" data-toggle=\"collapse\" data-parent=\"#accordion\">Tax Effective Planning</a></h4>\r\n</div>\r\n<div id=\"tax-effective-planning\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>Lawler Financial Services does not provide specific tax advice. However, the investment advice and financial strategies we provide may be structured in such a way that can reduce tax liability as well as increase after tax returns on your portfolio.</p>\r\n<p>Tax planning is an integral part of the financial planning process. Such strategies as structuring the way you receive your salary, contributing to superannuation, maintaining investments as well as managing debt can all contribute to significant tax savings and is an essential part of your wealth creation journey.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#direct-equities\" data-toggle=\"collapse\" data-parent=\"#accordion\">Direct Equities</a></h4>\r\n</div>\r\n<div id=\"direct-equities\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>Lawler Financial Services does not provide specific tax advice. However, the investment advice and financial strategies we provide may be structured in such a way that can reduce tax liability as well as increase after tax returns on your portfolio.</p>\r\n<p>Tax planning is an integral part of the financial planning process. Such strategies as structuring the way you receive your salary, contributing to superannuation, maintaining investments as well as managing debt can all contribute to significant tax savings and is an essential part of your wealth creation journey.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#protected-loans\" data-toggle=\"collapse\" data-parent=\"#accordion\">Protected Loans</a></h4>\r\n</div>\r\n<div id=\"protected-loans\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>Having a Protected Loan attached to an investment portfolio allows you to enjoy the benefits of a rising stock market without the risk of capital loss when markets fall.</p>\r\n<p>Capital gains, dividends and franking credits are received on the protected shares. However, if the securities fall in value your portfolio is protected from any loss. As long as you hold the shares, you will continue to receive any associated benefits. The stock price protection remains valid as long as you don\'t default on interest payments or terminate your loan early.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#insurance\" data-toggle=\"collapse\" data-parent=\"#accordion\">Insurance</a></h4>\r\n</div>\r\n<div id=\"insurance\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p> </p>\r\n<p>Insurance can help to protect your family and business during unexpected down time or loss. Each year thousands of Australians are injured, suffer a serious illness or die unexpectedly. If this happened in your family or business would you be able to afford:</p>\r\n<p> </p>\r\n<ul>\r\n<li>Your current living or operational expenses?</li>\r\n<li>Ongoing expenses such as the monthly mortgage or property rental payment?</li>\r\n<li>The cost of additional help?</li>\r\n<li>Sufficient retirement savings?</li>\r\n</ul>\r\n<p> </p>\r\n<p>We can help you find the right kind of cover for your situation and answer your questions about how to fund your insurance, how tax is affected, and whether your insurance can be held within your superannuation fund.</p>\r\n<p> </p>\r\n<p>Make an appointment with <a title=\"Link to Chris\'s contact details\" href=\"http://www.lawlerfs.com.au/chris-davis/\">Chris Davis</a> or <a title=\"Link to Aaron\'s contact details\" href=\"http://www.lawlerfs.com.au/aaron-wilkinson/\">Aaron Wilkinson</a>.</p>\r\n<p> </p>\r\n<div> \r\n<h2>WHEN SHOULD YOU CONSIDER INSURANCE?</h2>\r\n<p>Any time is a good time to review your personal situation. However, there are certain events during life which should prompt consideration of cover, such as:</p>\r\n<ul>\r\n<li>Getting married</li>\r\n<li>Having children</li>\r\n<li>Buying property or any other asset involving debt</li>\r\n<li>Starting your own business</li>\r\n<li>Setting up a Self Managed Super Fund</li>\r\n<li>Putting together a Financial Plan.</li>\r\n</ul>\r\n<p>You should review your insurance needs at least annually to take account of changes in your circumstances.</p>\r\n<h2><a name=\"Back to top\"></a>WHICH INSURANCE IS RIGHT FOR YOUR NEEDS?</h2>\r\n<p>There is a broad range of insurance products available, but which is right for <span>your</span> needs? We\'ve simplified the options into three broad categories to help you narrow down your search. Of course, you can make it even easier by giving our knowledgeable team a call for assistance on (02) 4928 7000.<br /><br /><a title=\"Link to risk insurance options\" href=\"http://www.lawlerfs.com.au/insurance/#Risk Insurance\">Risk Insurance</a></p>\r\n<p><a title=\"Link to information about life insurance\" href=\"http://www.lawlerfs.com.au/insurance/#Life Insurance\">Life</a><br /><a title=\"Link to information about Total Permanent Disability Insurance\" href=\"http://www.lawlerfs.com.au/insurance/#TPD\">Total Permanent Disability </a><br /><a title=\"Link to information about Critical Illness (Trauma Insurance)\" href=\"http://www.lawlerfs.com.au/insurance/#Critical Illness (Trauma Insurance)\">Critical Illness (Trauma Insurance) </a><br /><a title=\"Link to information about Income Protection Insurance\" href=\"http://www.lawlerfs.com.au/insurance/#Income Protection\">Income Protection</a></p>\r\n<p><br /><a title=\"Link to our information about business insurances\" href=\"http://www.lawlerfs.com.au/insurance/#Business Insurance\">Business Insurance</a></p>\r\n<p><a title=\"Link to information about Key Person Insurance\" href=\"http://www.lawlerfs.com.au/insurance/#Key Person\">Key Person </a><br /><a title=\"Link to information about debt insurance\" href=\"http://www.lawlerfs.com.au/insurance/#Debt\">Debt</a><br /><a title=\"Link to information about equity insurance\" href=\"http://www.lawlerfs.com.au/insurance/#Equity\">Equity</a><br /><a title=\"Link to information about Revenue Insurance\" href=\"http://www.lawlerfs.com.au/insurance/#Revenue\">Revenue</a></p>\r\n<p><br /><a title=\"Link to Business Succession insurance options\" href=\"http://www.lawlerfs.com.au/insurance/#Business Succession\">Business Succession</a></p>\r\n<p><a title=\"Link to information about Shareholders Agreements Insurance\" href=\"http://www.lawlerfs.com.au/insurance/#Shareholders Agreements\">Shareholders Agreements</a><br /><a title=\"Link to information about Buy/Sell Agreements Insurance\" href=\"http://www.lawlerfs.com.au/insurance/#Buy/Sell Agreements\">Buy/Sell Agreements</a><br /><a title=\"Link to information about Valuation Insurance\" href=\"http://www.lawlerfs.com.au/insurance/#Valuation\">Valuation</a><br /><a title=\"Link to information about Trigger Events Insurance\" href=\"http://www.lawlerfs.com.au/insurance/#Trigger Events\">Trigger Events</a></p>\r\n<p> </p>\r\n<h2><a name=\"Risk Insurance\"></a>RISK INSURANCE</h2>\r\n<h3><a name=\"Life Insurance\"></a>Life</h3>\r\n<p>Life insurance pays a lump sum to your family or other dependents upon your death. Your family can use the funds to meet commitments such as the mortgage or to maintain their standard of living.<br /><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back to top\">Back to top</a></p>\r\n<h3><a name=\"TPD\"></a>Total Permanent Disability (TPD)</h3>\r\n<p><br />TPD insurance pays a lump sum if you become totally and permanently disabled because of accident, illness or disease that prevents you from engaging in any occupation for which you are reasonably qualified.<br /><br />It helps you to adapt your lifestyle if you\'re unable to work, providing options that help you:</p>\r\n<ul>\r\n<li>Fund lifestyle changes and home modifications</li>\r\n<li>Cover the cost of long term care or medical expenses</li>\r\n<li>Pay off any debts including your mortgage</li>\r\n<li>Fund an ongoing income for your family.</li>\r\n</ul>\r\n<p><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back%20to%20top\">Back to top</a></p>\r\n<h3><a name=\"Critical Illness (Trauma Insurance)\"></a>Critical Illness (Trauma Insurance)</h3>\r\n<p>Trauma insurance pays a one off lump sum if you suffer a major trauma such as a stroke, heart attack, cancer or one of more than 30 other conditions. It can help to reduce the stress and financial pressure that comes with loss of income, medical bills and rehabilitation fees. The most common claims under these policies are for cancer, heart attack, coronary bypass and stroke.</p>\r\n<table width=\"100%\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<thead>\r\n<tr>\r\n<td colspan=\"3\">\r\n<p align=\"center\"><strong>List of common traumas that can be covered</strong></p>\r\n</td>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>Alzheimer\'s Disease</p>\r\n</td>\r\n<td>\r\n<p>Aplastic Anaemia</p>\r\n</td>\r\n<td>\r\n<p>Blindness</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Burns - Severe/Major</p>\r\n</td>\r\n<td>\r\n<p>Cancer</p>\r\n</td>\r\n<td>\r\n<p>Cardiomyopathy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Coma</p>\r\n</td>\r\n<td>\r\n<p>Coronary Artery Angio</p>\r\n</td>\r\n<td>\r\n<p>Coronary Bypass Surgery</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Deafness</p>\r\n</td>\r\n<td>\r\n<p>Dementia</p>\r\n</td>\r\n<td>\r\n<p>Diplegia</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Encephalitis</p>\r\n</td>\r\n<td>\r\n<p>Heart Attack</p>\r\n</td>\r\n<td>\r\n<p>Heart Valve Surgery</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Hemiplegia</p>\r\n</td>\r\n<td>\r\n<p>HIV - Occupational Acquired</p>\r\n</td>\r\n<td>\r\n<p>Kidney Failure - Chronic</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Liver Disease - Chronic</p>\r\n</td>\r\n<td>\r\n<p>Loss of Independence Existence</p>\r\n</td>\r\n<td>\r\n<p>Loss of Limbs or Eye</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Loss of Speech</p>\r\n</td>\r\n<td>\r\n<p>Lung Disease - Chronic</p>\r\n</td>\r\n<td>\r\n<p>Major Head Trauma</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Major Organ Transplant</p>\r\n</td>\r\n<td>\r\n<p>Motor Neurone Disease</p>\r\n</td>\r\n<td>\r\n<p>Multiple Sclerosis</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Paraplegia</p>\r\n</td>\r\n<td>\r\n<p>Parkinson\'s Disease</p>\r\n</td>\r\n<td>\r\n<p>Pulmonary Hypertension</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Quadriplegia</p>\r\n</td>\r\n<td>\r\n<p>Stroke</p>\r\n</td>\r\n<td>\r\n<p>Terminal Illness</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Life Cover - Death Benefit</p>\r\n</td>\r\n<td>\r\n<p>Total &amp; Permanent Disability</p>\r\n</td>\r\n<td>\r\n<p>Aortic Surgery</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Out of Hospital Cardiac Arrest</p>\r\n</td>\r\n<td>\r\n<p>Benign Brain Tumour</p>\r\n</td>\r\n<td>\r\n<p>HIV - Accidental Infection</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Peripheral Neuropathy</p>\r\n</td>\r\n<td> </td>\r\n<td> </td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back%20to%20top\">Back to top</a></p>\r\n<h3><a name=\"Income Protection\"></a>Income Protection</h3>\r\n<p>In the event of illness or accident, Income Protection Insurance ensures your cashflow continues, paying up to 75% of your gross income.<br /><br />It pays you (after your waiting period) up until you return to work or, if you\'re unable to return, up until retirement age (65, depending on your occupation).<br />It\'s tax deductible too. It\'s a great comfort to know you can keep paying your mortgage and other bills and just focus on getting well.</p>\r\n<p><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back%20to%20top\">Back to top</a></p>\r\n<h2><a name=\"Business Insurance\"></a>BUSINESS INSURANCE</h2>\r\n<p> </p>\r\n<h3><a name=\"Key Person\"></a>Key Person</h3>\r\n<p>Every business has crucial employees or associates upon which the prosperity and very survival of your organisation depends. Regardless of the business systems you have in place, there\'s often at least one person in your organisation whose unexpected departure would result in an immediate, irrevocable loss of corporate knowledge, ideas, expertise, clients, sales or capital.</p>\r\n<p>Without that Key Person’s presence and influence, your business would be adversely affected in a number of ways, such as:</p>\r\n<ul>\r\n<li>Business profitability</li>\r\n<li>Momentum</li>\r\n<li>Efficient management</li>\r\n<li>Goodwill and credit standing with suppliers</li>\r\n<li>Expense of locating and training a suitable successor</li>\r\n<li>Disruption to team and income while sourcing a replacement.</li>\r\n</ul>\r\n<p><br />This insurance is taken out by the business on the life of a Key Person to an amount that\'s sufficient to offset the estimated loss to the business of that person’s death, disablement, critical illness or early retirement. It can comprise Death, Total &amp; Permanent Disablement (Own occupation) and Trauma/Critical Illness covers.</p>\r\n<p><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back%20to%20top\">Back to top</a></p>\r\n<h3><a name=\"Debt\"></a>Debt</h3>\r\n<p><br />Most businesses use debt to seed and grow their operations. This debt is often secured against Directors\' homes or personal guarantees. If death, injury or trauma were to strike you or another Key Person in the business, this insurance payment could be used to repay debts and protect any personal or business assets used as loan security.</p>\r\n<p><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back%20to%20top\">Back to top</a></p>\r\n<h3><a name=\"Equity\"></a>Equity</h3>\r\n<p><br />Many businesses have no, or ineffectual, contingency management in place so in the event of the unexpected death of a business owner an otherwise successful business can die too.</p>\r\n<p>While business owners are alive they may negotiate a buy-out among themselves, for example, on an owner’s retirement. However, in the event of sudden death the remaining owners must negotiate with the deceased owner’s legal representative who may be more concerned about the needs of the estate than the needs of the business.</p>\r\n<p>Many business owners mistakenly believe that this contingency has been catered for in the organisation\'s constitutional documentation. However, there is often no buy-out provision or, where there is, it’s often ineffectually drawn up and inadequately funded. Similar issues arise when an owner is disabled and can\'t (or no longer wants to) be involved in the business.<br /><br />Ownership protection can provide the continuing owners or their nominees with sufficient cash for the transfer of the outgoing owner’s equity to the continuing owners, should a business owner die, become disabled or suffer a critical illness.</p>\r\n<p><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back%20to%20top\">Back to top</a></p>\r\n<h3><a name=\"Revenue\"></a>Revenue </h3>\r\n<p>A drop in revenue is inevitable when a key person departs. If there isn’t a suitable replacement within the business it may be a costly and time-consuming process to find and train a successor. Other losses that may occur, for example, may be demand that can’t be met, errors of judgment by a less experienced replacement or reduced productivity through low employee morale.<br /><br />Revenue protection can provide your business with cash to compensate for the loss of revenue and costs of replacing a key employee or business owner should they die, become disabled or depart unexpectedly.</p>\r\n<p><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back%20to%20top\">Back to top</a></p>\r\n<p> </p>\r\n<h2><a name=\"Business Succession\"></a>BUSINESS SUCCESSION</h2>\r\n<p> </p>\r\n<h3><a name=\"Shareholders Agreements\"></a>Shareholders Agreements</h3>\r\n<p>A shareholders agreement is a critical component of a business succession plan. It allows shareholders to exercise their rights associated with shares and allows for a smooth transition to occur when a shareholder exits the business. It provides clarity around:</p>\r\n<ul>\r\n<li>Exit strategies for key people/owners</li>\r\n<li>Ownership entities</li>\r\n<li>Extinguishment of personal/directors\' guarantees</li>\r\n<li>Buy/sell agreements</li>\r\n<li>Valuation</li>\r\n<li>Funding mechanisms and time frames</li>\r\n<li>Areas that are not dealt with in the organisation\'s Constitution.</li>\r\n</ul>\r\n<p><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back%20to%20top\">Back to top</a></p>\r\n<h3><a name=\"Buy/Sell Agreements\"></a>Buy/Sell Agreements</h3>\r\n<p>These contracts between business partners document arrangements for specific events, also known as trigger events, such as retirement, resignation, illness, disablement, default or death. Key elements include:</p>\r\n<ul>\r\n<li>The agreement is often linked to an equity holder’s insurance</li>\r\n<li>The insurance policies provide surviving equity holders with the necessary funding to purchase the deceased/disabled equity holder\'s interest</li>\r\n<li>The agreement takes into consideration the business structure and ownership i.e. individual, partnership, family trust or company</li>\r\n<li>They involve an agreed valuation methodology.</li>\r\n</ul>\r\n<p><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back%20to%20top\">Back to top</a></p>\r\n<h3><a name=\"Valuation\"></a>Valuation</h3>\r\n<p>A Buy/Sell Agreement states how the financial value of a business will be determined and there is a range of methodologies that may be used:</p>\r\n<ul>\r\n<li>Book value</li>\r\n<li>Agreed value</li>\r\n<li>Industry ‘rule of thumb’</li>\r\n<li>Capitalisation of maintainable earnings.</li>\r\n</ul>\r\n<p><br />You\'ll need legal and tax advice to choose the most suitable methodology. Lawler Financial Services works with your trusted advisors to ensure an effective valuation is in place and manages the entire process for you.</p>\r\n<p><a title=\"Go back to the insurances list\" href=\"http://www.lawlerfs.com.au/insurance/#Back%20to%20top\">Back to top</a></p>\r\n<h3><a name=\"Trigger Events\"></a>Trigger Events</h3>\r\n<p>These are events that can impact business both for you and your business partners and can include:</p>\r\n<ul>\r\n<li>Retirement</li>\r\n<li>Resignation</li>\r\n<li>Serious illness</li>\r\n<li>Default</li>\r\n<li>Disablement</li>\r\n<li>Death.</li>\r\n</ul>\r\n<p>Lawler Financial Services can ensure that thorough preparation and planning is in place for you and your business partners for such an event. We\'ll help you to ensure streamlined business succession and to avoid financial setbacks.</p>\r\n<div> </div>\r\n</div>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- services-->')
