 ,(90,'<p>Information copyright BT Financial Group, posted 1 March 2012.</p>\r\n<div class=\"disclaimer\">Abstract</div>\r\n<div class=\"disclaimer\">The Australian share market had a moderate month in February, advancing by 0.8%, to bring its gain for the year to date to 6.0%. The US share market once again did better, rising by 4.1%, as measured by the S&amp;P index. This puts the year-to gain at 8.6%, with this measure of the market at its highest level since June 2008, and up by a remarkable 102% from its closing trough on 9 March 2009. It perplexes many investors that the US market has outperformed the Australian market, which is up less than 40% from its March 2009 low. Suffice it to say that such comparisons always depend critically on the starting point. Measure both markets from 2000, for example, and we have outperformed by a street.</div>\r\n<div class=\"disclaimer\"><br /><a href=\"http://www.bt.com.au/bt-market-insights/bt-latest-updates/2012/03-march/20120301-catons-corner.asp\">Access the full article</a></div>')
