 ,(97,'<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#retirement-planning\" data-toggle=\"collapse\" data-parent=\"#accordion\">Retirement Planning </a></h4>\r\n</div>\r\n<div id=\"retirement-planning\" class=\"panel-collapse collapse in\">\r\n<div class=\"panel-body\">\r\n<p>Having a financial plan for your retirement years is essential to help you achieve the life you want to live in retirement.</p>\r\n<p>There is a growing trend that Australians are retiring earlier from full time employment and generally living much longer than previous generations. People are now spending more than a quarter of their lives in retirement, but how far will their accumulated savings last, and what kind of lifestyle will be available to them?</p>\r\n<p>This is where Lawler Financial Services can assist you with a strategy to help you live the lifestyle you\'d like when you reach retirement.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#investment-advice\" data-toggle=\"collapse\" data-parent=\"#accordion\"> Investment Advice </a></h4>\r\n</div>\r\n<div id=\"investment-advice\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>The principles of investing are simple when you know the best way to reach your accumulation goals. Principles of dollar cost averaging, compounding interest, a regular savings plan, as well as placing your money in an appropriate investment facility to suit your unique needs can reap rewards when you stick to the plan.</p>\r\n<p>Our investment recommendations are customised to your specific requirements and can extend to any or all of the following asset classes:</p>\r\n<ul>\r\n<li><strong>Australian Equities</strong> - Direct, Index Funds or Actively Managed Funds</li>\r\n<li><strong>International Equities</strong> - Index Funds or Actively Managed Funds</li>\r\n<li><strong>Emerging Markets</strong> - Actively Managed Funds</li>\r\n<li><strong>Property Securities</strong> - Index Funds or Actively Managed Funds</li>\r\n<li><strong>Government Bonds</strong> - Direct, Index Funds or Actively Managed Funds</li>\r\n<li><strong>Corporate Bonds</strong> - Direct, Index Funds or Actively Managed Funds</li>\r\n<li><strong>Term Deposits</strong></li>\r\n</ul>\r\n<p>Our team works with you to provide advice on how to best meet your investment goals.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#superannuation-wealth-creation-strategies\" data-toggle=\"collapse\" data-parent=\"#accordion\"> Superannuation &amp; Wealth Creation Strategies </a></h4>\r\n</div>\r\n<div id=\"superannuation-wealth-creation-strategies\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>Superannuation is one of the most tax-effective ways of saving for your retirement. The maximum rate of tax you’ll pay on your earnings in your super fund is 15% and you’re not charged tax on withdrawals from super once you turn 60, whereas earnings on your normal savings outside super are taxed at your marginal tax rate, which can be anywhere up to 46.5% including Medicare levy.</p>\r\n<p>While you can shift your super between super funds, remember that contributions to super are almost always compulsorily preserved. This means that you generally can’t withdraw the funds until you are over 55 (increasing to age 60 if you were born after 1 July 1964) and meet a condition of release.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#self-managed-super-funds\" data-toggle=\"collapse\" data-parent=\"#accordion\">Self Managed Super Funds </a></h4>\r\n</div>\r\n<div id=\"self-managed-super-funds\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>An SMSF is a trust where money or assets are held and managed on behalf of up to four members to provide benefits for their retirement. It\'s the most flexible of superannuation options with investment choices limited only to the investment strategy of the superannuation fund.</p>\r\n<p>Subject to certain exceptions, all members of an SMSF must be trustees of the SMSF or directors of the SMSF’s corporate trustee.</p>\r\n<p>The investment strategy must comply with the provisions of the Superannuation Industry (Supervision) Act 1993. Therefore, in addition to the wide selection of managed funds, you may also have real property in your superannuation fund and the universe of CHESS listed securities, provided the investment strategy of the fund allows this.</p>\r\n<p>Like all super funds, an SMSF receives concessional tax treatment. The top tax rate for the investment earnings of your SMSF is 15%. This tax concession is only available if your fund complies with all the rules and regulations that apply to SMSFs. In other words, it\'s a ‘complying fund’.</p>\r\n<p>Advising the trustees of an SMSF is a specialised area and our Financial Advisers have extensive training and experience in advising those who have or would like to establish an SMSF.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#tax-effective-planning\" data-toggle=\"collapse\" data-parent=\"#accordion\">Tax Effective Planning</a></h4>\r\n</div>\r\n<div id=\"tax-effective-planning\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>Lawler Financial Services does not provide specific tax advice. However, the investment advice and financial strategies we provide may be structured in such a way that can reduce tax liability as well as increase after tax returns on your portfolio.</p>\r\n<p>Tax planning is an integral part of the financial planning process. Such strategies as structuring the way you receive your salary, contributing to superannuation, maintaining investments as well as managing debt can all contribute to significant tax savings and is an essential part of your wealth creation journey.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#direct-equities\" data-toggle=\"collapse\" data-parent=\"#accordion\">Direct Equities</a></h4>\r\n</div>\r\n<div id=\"direct-equities\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>Lawler Financial Services does not provide specific tax advice. However, the investment advice and financial strategies we provide may be structured in such a way that can reduce tax liability as well as increase after tax returns on your portfolio.</p>\r\n<p>Tax planning is an integral part of the financial planning process. Such strategies as structuring the way you receive your salary, contributing to superannuation, maintaining investments as well as managing debt can all contribute to significant tax savings and is an essential part of your wealth creation journey.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#protected-loans\" data-toggle=\"collapse\" data-parent=\"#accordion\">Protected Loans</a></h4>\r\n</div>\r\n<div id=\"protected-loans\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p>Having a Protected Loan attached to an investment portfolio allows you to enjoy the benefits of a rising stock market without the risk of capital loss when markets fall.</p>\r\n<p>Capital gains, dividends and franking credits are received on the protected shares. However, if the securities fall in value your portfolio is protected from any loss. As long as you hold the shares, you will continue to receive any associated benefits. The stock price protection remains valid as long as you don\'t default on interest payments or terminate your loan early.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#insurance\" data-toggle=\"collapse\" data-parent=\"#accordion\">Insurance</a></h4>\r\n</div>\r\n<div id=\"insurance\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<p> </p>\r\n<p>Insurance can help to protect your family and business during unexpected down time or loss. Each year thousands of Australians are injured, suffer a serious illness or die unexpectedly. If this happened in your family or business would you be able to afford:</p>\r\n<p> </p>\r\n<ul>\r\n<li>Your current living or operational expenses?</li>\r\n<li>Ongoing expenses such as the monthly mortgage or property rental payment?</li>\r\n<li>The cost of additional help?</li>\r\n<li>Sufficient retirement savings?</li>\r\n</ul>\r\n<p> </p>\r\n<p>We can help you find the right kind of cover for your situation and answer your questions about how to fund your insurance, how tax is affected, and whether your insurance can be held within your superannuation fund.</p>\r\n<p> </p>\r\n<p>Make an appointment with <a title=\"Link to Chris\'s contact details\" href=\"http://www.lawlerfs.com.au/chris-davis/\">Chris Davis</a> or <a title=\"Link to Aaron\'s contact details\" href=\"http://www.lawlerfs.com.au/aaron-wilkinson/\">Aaron Wilkinson</a>.</p>\r\n<p><a href=\"insurance\">Learn more</a> about Insurance.</p>\r\n<p> </p>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- services-->')
