 ,(148,'<h4>Insurance, Estate Planning</h4>\r\n<p>Senior Risk Adviser Chris Davis is head of the risk management team at Lawler Financial Services.</p>\r\n<p>Chris completed a Bachelor of Commerce at The University of Newcastle in 1997 and since then has worked in the financial services industry in both Sydney and Newcastle, joining Lawler Financial Services in 2006. He has a Diploma in Financial Planning, is a Life Risk Specialist with the Financial Planning Association of Australia (FPA) and is an authorised representative of Securitor Financial Group Ltd.  <br /><br />\'Appropriate insurance protection forms the foundation for a client’s financial future,\' he says, \'and implementing long-term sustainable risk insurance protection forms a critical part of the overall service package that our clients receive.\'</p>\r\n<p><br />Chris enjoys spending time with his young family and is a passionate surfer who is often spotted at Merewether Beach.</p>\r\n<p> </p>\r\n<h4>Professional Snapshot</h4>\r\n<p>ASIC authorised representative identification number: <strong>321627</strong></p>\r\n<p>Authorised by Securitor to provide Financial Services including advice under Securitor’s licence on the following financial products:</p>\r\n<ul>\r\n<li>Managed investments</li>\r\n<li>Superannuation</li>\r\n<li>Personal insurance.</li>\r\n</ul>\r\n<p>Not authorised to provide advice, services or products (but can provide a referral) in:</p>\r\n<ul>\r\n<li>Mortgage broking</li>\r\n<li>Finance broking</li>\r\n<li>Shares</li>\r\n<li>Self Managed Superannuation Funds – investment advice only (including advice to establish an SMSF).</li>\r\n</ul>\r\n<div id=\"sub-content-sidebar\">\r\n<div class=\"module contact-details\">\r\n<h4>Contact Information</h4>\r\n<ul>\r\n<li>(02) 4928 7000</li>\r\n</ul>\r\n</div>\r\n</div>')
 ,(149,'<h3>Insurance, Estate Planning</h3>\r\n<p>Senior Risk Adviser Chris Davis is head of the risk management team at Lawler Financial Services.</p>\r\n<p>Chris completed a Bachelor of Commerce at The University of Newcastle in 1997 and since then has worked in the financial services industry in both Sydney and Newcastle, joining Lawler Financial Services in 2006. He has a Diploma in Financial Planning, is a Life Risk Specialist with the Financial Planning Association of Australia (FPA) and is an authorised representative of Securitor Financial Group Ltd.  <br /><br />\'Appropriate insurance protection forms the foundation for a client’s financial future,\' he says, \'and implementing long-term sustainable risk insurance protection forms a critical part of the overall service package that our clients receive.\'</p>\r\n<p><br />Chris enjoys spending time with his young family and is a passionate surfer who is often spotted at Merewether Beach.</p>\r\n<p> </p>\r\n<hr />\r\n<p> </p>\r\n<h3>Professional Snapshot</h3>\r\n<p>ASIC authorised representative identification number: <strong>321627</strong></p>\r\n<p>Authorised by Securitor to provide Financial Services including advice under Securitor’s licence on the following financial products:</p>\r\n<ul>\r\n<li>Managed investments</li>\r\n<li>Superannuation</li>\r\n<li>Personal insurance.</li>\r\n</ul>\r\n<p>Not authorised to provide advice, services or products (but can provide a referral) in:</p>\r\n<ul>\r\n<li>Mortgage broking</li>\r\n<li>Finance broking</li>\r\n<li>Shares</li>\r\n<li>Self Managed Superannuation Funds – investment advice only (including advice to establish an SMSF).</li>\r\n</ul>\r\n<div><hr /></div>\r\n<div id=\"sub-content-sidebar\">\r\n<div class=\"module contact-details\">\r\n<h3>Contact Information</h3>\r\n<ul>\r\n<li>(02) 4928 7000</li>\r\n</ul>\r\n</div>\r\n</div>')
