 ,(156,'<p><span>Director and Financial Adviser Mark Arnold has been providing financial advice since 1988 and his more than 25 years experience in accounting, taxation and other financial services disciplines has earned him respect in the industry. He is regularly invited to present at seminars on financial planning for CPA Australia and frequently quoted on financial matters in the media.</span><br /><br /><span>Mark has lectured in financial planning at The University of Newcastle and was Honorary Conjoint Lecturer to the Faculty of Business and Economics. He is co-author of the text ‘Introduction to Individual Financial Planning’ and also a Justice of the Peace.</span></p>')
