 ,(159,'<p><span>Certified Financial Planner Craig Sawyer has been providing financial advice to clients since 1993. He holds a CFP (Certified Financial Planner), Diploma of Financial Planning and Advanced Commerce Certificate. </span></p>')
 ,(161,'<p>Craig started his career as an Accountant in 1990 at his family\'s renowned manufacturing company, Ampcontrol Pty Ltd, where he gained valuable experience before moving into the chartered environment with Lawler Partners in 1993 as Superannuation Manager.</p>\r\n<p>When the Lawler group commenced business in the financial planning industry in 1998 Craig was engaged as a Senior Adviser due to his experience and specialist skill in the Superannuation environment, and in particular with Self Managed Super Funds.</p>\r\n<p>His combined 18 years in superannuation with previous public practice accounting experience enables him to offer clients a holistic view of wealth maximisation across all entities and taxation structures.</p>\r\n<p>As a holder of the Specialist Adviser designation within the Self-Managed Super Fund Professionals’ Association of Australia (SPAA), Craig also has in depth expertise in this area.</p>\r\n<p>Craig and wife Sharon live in the Newcastle region with their two young boys.</p>\r\n<p>Craig was awarded Securitor Adviser of the Year Award for 2012 in April and this could not be achieved without the faith of our clients in our service and commitment.</p>\r\n<h3>Professional Snapshot</h3>\r\n<p>ASIC Authorised Representative number:<strong>239484<br /></strong>ASIC Credit Representative number: <strong>378846</strong><br />Specialist Adviser - SMSF Professionals\' Association</p>\r\n<p>Authorised by Securitor to provide Financial Services including advice under Securitor’s licence on the following financial products:</p>\r\n<ul>\r\n<li>Managed investments</li>\r\n<li>Superannuation</li>\r\n<li>Self Managed Superannuation Funds – investment advice only (including advice to establish an SMSF)</li>\r\n<li>Shares</li>\r\n<li>Margin lending.</li>\r\n</ul>\r\n<p>Not authorised to provide advice, services or products (but can provide a referral) in:</p>\r\n<ul>\r\n<li>Personal insurance</li>\r\n<li>Mortgage broking</li>\r\n<li>Finance broking.</li>\r\n</ul>')
 ,(163,'<p>Mandy joined the Lawler Financial Services team in July 2006 in the Administration and Client Services role. She has more than eight years experience in the retail financial services industry.</p>\r\n<p>People are important to her. Prior to joining the financial industry she worked for more than 20 years in face to face sales, managing branches for such organisations as Colorado and JeansWest.</p>\r\n<p>Being a people person, Mandy says, \'I don\'t get to see as much of our clients as I\'d like.\' However, her management skills are invaluable and she uses them to ensure that clients are serviced well from an administrative perspective.</p>\r\n<p>\'I really like our clients. I\'ve built good relationships with them.\'</p>')
 ,(178,'<p><span>Certified Financial Planner Craig Sawyer has been providing financial advice to clients since 1993. He holds a CFP (Certified Financial Planner), Diploma of Financial Planning and Advanced Commerce Certificate. </span></p>\r\n<p><span><br /></span></p>\r\n<p>Craig started his career as an Accountant in 1990 at his family\'s renowned manufacturing company, Ampcontrol Pty Ltd, where he gained valuable experience before moving into the chartered environment with Lawler Partners in 1993 as Superannuation Manager.</p>\r\n<p>When the Lawler group commenced business in the financial planning industry in 1998 Craig was engaged as a Senior Adviser due to his experience and specialist skill in the Superannuation environment, and in particular with Self Managed Super Funds.</p>\r\n<p>His combined 18 years in superannuation with previous public practice accounting experience enables him to offer clients a holistic view of wealth maximisation across all entities and taxation structures.</p>\r\n<p>As a holder of the Specialist Adviser designation within the Self-Managed Super Fund Professionals’ Association of Australia (SPAA), Craig also has in depth expertise in this area.</p>\r\n<p>Craig and wife Sharon live in the Newcastle region with their two young boys.</p>\r\n<p>Craig was awarded Securitor Adviser of the Year Award for 2012 in April and this could not be achieved without the faith of our clients in our service and commitment.</p>\r\n<h3>Professional Snapshot</h3>\r\n<p>ASIC Authorised Representative number:<strong>239484<br /></strong>ASIC Credit Representative number: <strong>378846</strong><br />Specialist Adviser - SMSF Professionals\' Association</p>\r\n<p>Authorised by Securitor to provide Financial Services including advice under Securitor’s licence on the following financial products:</p>\r\n<ul>\r\n<li>Managed investments</li>\r\n<li>Superannuation</li>\r\n<li>Self Managed Superannuation Funds – investment advice only (including advice to establish an SMSF)</li>\r\n<li>Shares</li>\r\n<li>Margin lending.</li>\r\n</ul>\r\n<p>Not authorised to provide advice, services or products (but can provide a referral) in:</p>\r\n<ul>\r\n<li>Personal insurance</li>\r\n<li>Mortgage broking</li>\r\n<li>Finance broking. </li>\r\n</ul>\r\n<p><span><br /></span></p>')
 ,(183,'<p>Damien is an Authorised Financial Adviser and a Member of the Institute of Chartered Accountants in Australia who specialises in wealth creation across all entities. He has extensive experience as a financial adviser, having practiced in accounting, superannuation and related fields since 1991. Qualified through SPAA as a Specialist Advisor, he provides strategic and investment advice to a wide range of clients. <br /><br />His combined 15 years in superannuation with previous public practice accounting experience enables him to offer clients a holistic view of wealth maximisation across all entities and taxation structures. In addition, Damien’s prior experience in tax and business services means that he is able to work proactively with other advisers to his clients, such as their accountants and solicitors.<br /><br />As a holder of the Specialist Adviser designation within the Self-Managed Super Fund Professionals’ Association of Australia (SPAA), Damien also has in depth expertise in this area.</p>\r\n<h3>Professional Snapshot</h3>\r\n<p>ASIC Authorised Representative number:<strong>305752<br /></strong>ASIC Credit Representative number: <strong>378795</strong></p>\r\n<p>Authorised by Securitor to provide Financial Services including advice under Securitor’s licence on the following financial products:</p>\r\n<ul>\r\n<li>Managed investments</li>\r\n<li>Superannuation</li>\r\n<li>Shares</li>\r\n<li>Margin lending</li>\r\n<li>Self Managed Superannuation Funds – investment advice only (including advice to establish an SMSF).</li>\r\n</ul>\r\n<p>Not authorised to provide advice, services or products (but can provide a referral) in:</p>\r\n<ul>\r\n<li>Personal insurance</li>\r\n<li>Mortgage broking</li>\r\n<li>Finance broking.</li>\r\n</ul>\r\n<p>Qualifications:</p>\r\n<ul>\r\n<li>Graduate Certification - Financial Planning (Finsia)</li>\r\n<li>Chartered Accountant - ICAA</li>\r\n<li>Specialist Adviser - SMSF Professionals\' Association</li>\r\n<li>Bachelor of Commerce - University of Newcastle</li>\r\n<li></li>\r\n</ul>')
