INSERT INTO btDCServiceBox VALUES(136,'estate-planning','Estate Planning',NULL,'<p>Passing control of your assets to your intended beneficiaries on death is a critical concern for many Australians. There are many issues that should be considered when formulating an estate plan, such as tax effective strategies for beneficiaries and protecting your assets from legal disputes.</p>\r\n<p>Our team can assist you to ensure that your estate is protected and administered in a cost effective and timely manner.</p>\r\n<p>A good estate plan can provide you with peace of mind and help avoid potential complications for your beneficiaries.</p>\r\n<p><span style=\"color: #800080;\"><a href=\"http://www.lawlerfs.com.au/contact-us/\"><span style=\"color: #800080;\">Make an enquiry</span></a> </span>with one of our Authorised Financial Planners.</p>',1)
 ,(220,'retirement-planning','Retirement Planning',NULL,'<p>Having a financial plan for your retirement years is essential to help you achieve the life you want to live in retirement.</p>\r\n<p>There is a growing trend that Australians are retiring earlier from full time employment and generally living much longer than previous generations. People are now spending more than a quarter of their lives in retirement, but how far will their accumulated savings last, and what kind of lifestyle will be available to them?</p>\r\n<p>This is where Lawler Financial Services can assist you with a strategy to help you live the lifestyle you\'d like when you reach retirement.</p>\r\n<p><span style=\"color: #800080;\"><a title=\"Contact Us\" href=\"contact-us\"><span style=\"color: #800080;\">Make an enquiry</span></a></span> with one of our Authorised Financial Planners.</p>',2)
 ,(221,'investment-advice','Investment Advice',NULL,'<p>The principles of investing are simple when you know the best way to reach your accumulation goals. Principles of dollar cost averaging, compounding interest, a regular savings plan, as well as placing your money in an appropriate investment facility to suit your unique needs can reap rewards when you stick to the plan.</p>\r\n<p>Our investment recommendations are customised to your specific requirements and can extend to any or all of the following asset classes:</p>\r\n<ul>\r\n<li><strong>Australian Equities</strong> - Direct, Index Funds or Actively Managed Funds</li>\r\n<li><strong>International Equities</strong> - Index Funds or Actively Managed Funds</li>\r\n<li><strong>Emerging Markets</strong> - Actively Managed Funds</li>\r\n<li><strong>Property Securities</strong> - Index Funds or Actively Managed Funds</li>\r\n<li><strong>Government Bonds</strong> - Direct, Index Funds or Actively Managed Funds</li>\r\n<li><strong>Corporate Bonds</strong> - Direct, Index Funds or Actively Managed Funds</li>\r\n<li><strong>Term Deposits</strong></li>\r\n</ul>\r\n<p>Our team works with you to provide advice on how to best meet your investment goals.</p>\r\n<p><span style=\"color: #800080;\"><a title=\"Contact Us\" href=\"contact-us\"><span style=\"color: #800080;\">Make an enquiry</span></a></span> with one of our Authorised Financial Planners.</p>',2)
 ,(222,'superannuation-wealth-creation-strategies','Superannuation and Wealth Creation Strategies',NULL,'<p>Superannuation is one of the most tax-effective ways of saving for your retirement. The maximum rate of tax you’ll pay on your earnings in your super fund is 15% and you’re not charged tax on withdrawals from super once you turn 60, whereas earnings on your normal savings outside super are taxed at your marginal tax rate, which can be anywhere up to 46.5% including Medicare levy.</p>\r\n<p>While you can shift your super between super funds, remember that contributions to super are almost always compulsorily preserved. This means that you generally can’t withdraw the funds until you are over 55 (increasing to age 60 if you were born after 1 July 1964) and meet a condition of release.</p>\r\n<p><span style=\"color: #800080;\"><a title=\"Contact Us\" href=\"contact-us\"><span style=\"color: #800080;\">Make an enquiry</span></a></span> with one of our Authorised Financial Planners.</p>',1)
 ,(223,'self-managed-super-funds','Self Managed Super Funds',NULL,'<p>An SMSF is a trust where money or assets are held and managed on behalf of up to four members to provide benefits for their retirement. It\'s the most flexible of superannuation options with investment choices limited only to the investment strategy of the superannuation fund.</p>\r\n<p>Subject to certain exceptions, all members of an SMSF must be trustees of the SMSF or directors of the SMSF’s corporate trustee.</p>\r\n<p>The investment strategy must comply with the provisions of the Superannuation Industry (Supervision) Act 1993. Therefore, in addition to the wide selection of managed funds, you may also have real property in your superannuation fund and the universe of CHESS listed securities, provided the investment strategy of the fund allows this.</p>\r\n<p>Like all super funds, an SMSF receives concessional tax treatment. The top tax rate for the investment earnings of your SMSF is 15%. This tax concession is only available if your fund complies with all the rules and regulations that apply to SMSFs. In other words, it\'s a ‘complying fund’.</p>\r\n<p>Advising the trustees of an SMSF is a specialised area and our Financial Advisers have extensive training and experience in advising those who have or would like to establish an SMSF.</p>\r\n<p><span style=\"color: #800080;\"><a title=\"Contact Us\" href=\"contact-us\"><span style=\"color: #800080;\">Make an enquiry</span></a></span> with one of our Authorised Financial Planners.</p>',1)
 ,(224,'tax-effective-planning','Tax Effective Planning',NULL,'<p>Lawler Financial Services does not provide specific tax advice. However, the investment advice and financial strategies we provide may be structured in such a way that can reduce tax liability as well as increase after tax returns on your portfolio.</p>\r\n<p>Tax planning is an integral part of the financial planning process. Such strategies as structuring the way you receive your salary, contributing to superannuation, maintaining investments as well as managing debt can all contribute to significant tax savings and is an essential part of your wealth creation journey.</p>\r\n<p><a title=\"Contact Us\" href=\"contact-us\"><span style=\"color: #800080;\">Make an enquiry</span></a>with one of our Authorised Financial Planners.</p>',1)
 ,(225,'direct-equities','Direct Equities',NULL,'<p>Lawler Financial Services does not provide specific tax advice. However, the investment advice and financial strategies we provide may be structured in such a way that can reduce tax liability as well as increase after tax returns on your portfolio.</p>\r\n<p>Tax planning is an integral part of the financial planning process. Such strategies as structuring the way you receive your salary, contributing to superannuation, maintaining investments as well as managing debt can all contribute to significant tax savings and is an essential part of your wealth creation journey.</p>\r\n<p><span style=\"color: #800080;\"><a title=\"Contact Us\" href=\"contact-us\"><span style=\"color: #800080;\">Make an enquiry</span></a></span> with one of our Authorised Financial Planners.</p>',1)
 ,(226,'protected-loans','Protected Loans',NULL,'<p>Having a Protected Loan attached to an investment portfolio allows you to enjoy the benefits of a rising stock market without the risk of capital loss when markets fall.</p>\r\n<p>Capital gains, dividends and franking credits are received on the protected shares. However, if the securities fall in value your portfolio is protected from any loss. As long as you hold the shares, you will continue to receive any associated benefits. The stock price protection remains valid as long as you don\'t default on interest payments or terminate your loan early.</p>\r\n<p><span style=\"color: #800080;\"><a title=\"Contact Us\" href=\"contact-us\"><span style=\"color: #800080;\">Make an enquiry</span></a> </span>with one of our Authorised Financial Planners.</p>',1)
 ,(227,'insurance','Insurance',NULL,'<p>Insurance can help to protect your family and business during unexpected down time or loss. Each year thousands of Australians are injured, suffer a serious illness or die unexpectedly. If this happened in your family or business would you be able to afford:</p>\r\n<p> </p>\r\n<ul>\r\n<li>Your current living or operational expenses?</li>\r\n<li>Ongoing expenses such as the monthly mortgage or property rental payment?</li>\r\n<li>The cost of additional help?</li>\r\n<li>Sufficient retirement savings?</li>\r\n</ul>\r\n<p> </p>\r\n<p>We can help you find the right kind of cover for your situation and answer your questions about how to fund your insurance, how tax is affected, and whether your insurance can be held within your superannuation fund.</p>\r\n<p> </p>\r\n<p>Make an appointment with <span style=\"color: #800080;\"><a title=\"Link to Chris\'s contact details\" href=\"http://www.lawlerfs.com.au/chris-davis/\"><span style=\"color: #800080;\">Chris Davis</span></a></span>.</p>\r\n<p><span style=\"color: #800080;\"><a href=\"insurance\"><span style=\"color: #800080;\">Learn more</span></a></span> about Insurance.</p>',1)
 ,(235,'margin-lending','Margin Lending',NULL,'<p>Margin lending, also known as \'gearing\', enables you borrow money to invest in shares, managed funds, master trusts and wraps.</p>\r\n<p>By borrowing to invest, rather than just using your own money, you increase potential for greater returns. The down side of this, though, is that it also magnifies the potential for losses if investments perform poorly so it’s not a strategy for every investor.</p>\r\n<p>Just like investing in property where the loan is secured against the property, your margin loan is secured against your investments.</p>\r\n<p><a title=\"Link to our team profiles\" href=\"index.php/contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>',1)
 ,(237,'negative-gearing','Negative Gearing',NULL,'<p>Borrowing to invest, also known as \'gearing\', allows you to buy into investments that you would not otherwise be able to access.</p>\r\n<p>Most people associate negative gearing with buying an investment property. However, borrowed funds can also be used for shares, managed funds or bonds.</p>\r\n<p>While many adopt a negative gearing strategy for its tax advantages, it\'s important to be aware that a tax deduction can only be claimed if there is a loss on the investment. This means it\'s important to borrow sensibly because, similar to <a title=\"Link to information about margin lending\" href=\"index.php/services#margin-lending\">margin lending</a>, gearing can amplify investment gains as well as magnify losses.</p>\r\n<p><a title=\"Link to our team profiles\" href=\"index.php/contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>',1)
 ,(238,'instalment-gearing','Instalment Gearing',NULL,'<p>Not everyone can borrow a large lump sum of money for the purpose of building an investment portfolio. Instalment gearing enables you to take advantage of the principle of dollar cost averaging by periodically drawing from an investment loan. Regular monthly contributions in a fluctuating share market can yield strong results over the medium to long term, and adding your own money to the borrowed funds can help boost your investment to achieve your financial goals.</p>\r\n<p>Instalment Gearing is also an effective tax strategy because the interest on your borrowing is tax deductible.</p>\r\n<p><a title=\"Link to our team profiles\" href=\"index.php/contact-us\">Make an enquiry</a> with one of our Authorised Financial Planners.</p>',1);

